import React from "react";
import styles from "../styles/markercontent.module.scss";
import { getPost } from "../interface/posts";
import {useNavigate} from "react-router-dom";

interface PostContentProps {
    post: getPost;
}

function MarkerContent({ post }: PostContentProps) {
    const navigate = useNavigate();
    // onClick 함수에서 백틱을 사용하여 템플릿 리터럴을 적용
    const onClick = () => {
        navigate(`/post/${post.id}`);
    }
    return (
        <div className={styles.container}>
            <h4>{post.title}</h4>
            <p>Date: {post.date}</p>
            <p>Time: {post.time}</p>
            <p>Location: {post.location}</p>
            <button className={styles.button} onClick={onClick}>게시글로 이동 ➔</button>
        </div>
    );
}

export default MarkerContent;
